/**
 * Adds two numbers
 * @param {number} a
 * @param {numer} b
 * @returns {number}
 */
const add = (a, b) => a + b;
/**
 * Subtracts two numbers
 * @param {number} a
 * @param {number} b
 * @returns {number}
 */
const subtract = (a, b) => a - b;
const multiply = (a, b) => a * b;
const divide = (a, b) => a / b;
export { add, divide, multiply, subtract };
